import React from "react";
import Navbarprofile from "../../Components/Navbarprofile/Navbarprofile";
import Navprofile from "../../Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { blue } from "@mui/material/colors";
import { useState } from "react";
import "./Profile.css";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
  MDBCardText,
} from "mdb-react-ui-kit";
import { Collapse } from "mdbreact";
import { Grid } from "@mui/material";
const Profile = () => {
  return (
    <Box sx={{ height: "100vh", backgroundColor: "red" }}>
      <Box sx={{ position: "fixed", top: 0, zIndex: 1 }}>
        <Navbarprofile />
      </Box>
      <Box sx={{ zIndex: 2, position: "fixed" }}>
        <Navprofile />
      </Box>
      <div
        style={{
          backgroundColor: "blue",
          display: "flex",
          alignItems: "center",
          marginTop: "40px",
        }}
      >
        <MDBContainer className="py-5 h-100" style={{ marginLeft: "0px" }}>
          <MDBRow className="justify-content-center align-items-center h-100">
            <MDBCol xl="12" lg="10" md="10" sm="10" xs="8">
              <MDBCard>
                <div
                  className="rounded-top text-white d-flex flex-row"
                  style={{ backgroundColor: "#000", height: "200px" }}
                >
                  <div
                    className="ms-4 mt-5 d-flex flex-column"
                    style={{ width: "150px", marginLeft: "30px" }}
                  >
                    <MDBCardImage
                      src=""
                      alt="Generic placeholder image"
                      className="mt-4 mb-2 img-thumbnail"
                      fluid
                      style={{ width: "150px", zIndex: "1" }}
                    />
                    <MDBBtn
                      outline
                      style={{
                        height: "36px",
                        overflow: "visible",
                        backgroundColor: "",
                      }}
                    >
                      Edit profile
                    </MDBBtn>
                  </div>
                  <div
                    className="ms-3"
                    style={{ marginTop: "130px", marginLeft: "50px" }}
                  >
                    <MDBTypography tag="h5">User name</MDBTypography>
                  </div>
                </div>
                <div
                  className="p-4 text-black"
                  style={{ backgroundColor: "#f8f9fa" }}
                ></div>
                <MDBCardBody>
                  <div>
                    <p style={{ color: "black" }}>Bio</p>
                    <div
                      className="p-4"
                      style={{ borderRadius: "10px solid " }}
                    >
                      <MDBCardText style={{ color: "black" }}>
                        jhqsgduqg
                      </MDBCardText>
                    </div>
                  </div>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
      </div>
    </Box>
  );
};

export default Profile;
